WHERE type = 'PO Box' AND city = 'San Juan' AND state = 'Puerto Rico';

SELECT event_name
FROM event
WHERE status = 'Closed' AND type = 'Game' AND event_date BETWEEN '2019-03-15' AND '2020-03-20';

SELECT event_id, location, status
FROM event
WHERE event_date BETWEEN '2019-11-01' AND '2020-03-31';

SELECT first_name, last_name
FROM member
WHERE t_shirt_size = 'extra large';

SELECT SUM(cost) / (SELECT SUM(cost) FROM budget WHERE category = 'Game') * 100 AS percentage_of_cost_for_game_events
FROM expense
WHERE category = 'Game';

SELECT category, amount
FROM budget
WHERE link_to_event = 'January Speaker';

SELECT first_name, last_name, college
FROM member
WHERE position = 'Secretary';

SELECT member.city
FROM member
WHERE member.last_name = 'Girke' AND member.first_name = 'Garrett';

SELECT first_name, last_name, position
FROM member
WHERE zip = 28092 AND city = 'Lincolnton' AND state = 'North Carolina';

SELECT GasStationID
FROM gasstations
WHERE Segment = 'Premium' AND Country = 'CZE';

SELECT SUM(Consumption)
FROM yearmonth
WHERE CustomerID = 6 AND Date BETWEEN '201308' AND '201311';

SELECT COUNT(*)
FROM gasstations
WHERE Country = 'Slovakia' AND Segment = 'Premium';

SELECT CustomerID, MAX(Consumption)
FROM yearmonth
WHERE Currency = 'EUR';

SELECT COUNT(*)
FROM transactions_1k
WHERE Country = 'Czech Republic' AND Price > 1000;

SELECT transactions_1k.ProductID
FROM transactions_1k
WHERE transactions_1k.Date = '2012-08-23' AND transactions_1k.Time = '21:20:00';
